            UpdateCampaignListOptions updatecampaignlistoptions3 = new UpdateCampaignListOptions(Integer.valueOf(-78),
                                                                                                 Long.valueOf(-11),
                                                                                                 Order.getDefault(),
                                                                                                 "5fb3efac-1ce4-41f0-8e63-8860f626ffe2",
                                                                                                 null, null);
            assertNotNull(updatecampaignlistoptions1);
